import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as h,a as s}from"./app-c5438559.js";const r={},t=s('<h1 id="hashmap的扩容是怎么实现的" tabindex="-1"><a class="header-anchor" href="#hashmap的扩容是怎么实现的" aria-hidden="true">#</a> HashMap的扩容是怎么实现的</h1><h2 id="hashmap的底层存储" tabindex="-1"><a class="header-anchor" href="#hashmap的底层存储" aria-hidden="true">#</a> HashMap的底层存储</h2><p>HashMap的底层是用数组实现的，当需要存储元素的时候，不断put元素进去，达到一定容量后会扩容，一是能存储的元素更多了，二是因为位置多了，查询效率也会更快，之前可能多个元素会通过<strong>拉链法</strong>放在同一个索引上，查询的时候还需要遍历链表，时间复杂度O(n)，如果位置多了，一个元素占一个索引，查找的时间复杂度就是O(1)。</p><h2 id="扩容机制" tabindex="-1"><a class="header-anchor" href="#扩容机制" aria-hidden="true">#</a> 扩容机制</h2><p>HashMap的扩容机制是通过<code>resize()</code>方法对数组进行扩容并且重新计算hash值实现的，扩容时会遍历所有元素并且计算hash值，当元素数量多时会比较耗时。</p>',5),c=[t];function n(o,d){return e(),h("div",null,c)}const _=a(r,[["render",n],["__file","3.html.vue"]]);export{_ as default};
